// AdminPanel.jsx

import React, { useState, useEffect } from 'react';
import { getAllBluebooksApi, updateBluebookStatusApi, deleteBluebookApi } from "../apis/Api";
import { toast } from "react-toastify";
import "./AdminPanel.css";

const AdminPanel = () => {
  const [bluebooks, setBluebooks] = useState([]);
  const [selectedBluebook, setSelectedBluebook] = useState(null);

  useEffect(() => {
    fetchAllBluebooks();
  }, []);

  const fetchAllBluebooks = async () => {
    try {
      const response = await getAllBluebooksApi();
      setBluebooks(response.data.bluebooks);
    } catch (error) {
      console.error('Error fetching bluebooks:', error);
      toast.error('Error fetching bluebooks');
    }
  };

  const handleUpdateStatus = async (bluebookId, newStatus) => {
    try {
      await updateBluebookStatusApi(bluebookId, { bluebookStatus: newStatus });
      setBluebooks(prevBluebooks =>
        prevBluebooks.map(bluebook =>
          bluebook._id === bluebookId ? { ...bluebook, bluebookStatus: newStatus } : bluebook
        )
      );
      toast.success('Bluebook status updated successfully');
    } catch (error) {
      console.error('Error updating bluebook status:', error);
      toast.error('Error updating bluebook status');
    }
  };

  const handleViewDetails = (bluebook) => {
    setSelectedBluebook(bluebook);
  };

  const handleDelete = async (bluebookId) => {
    try {
      await deleteBluebookApi(bluebookId);
      setBluebooks(prevBluebooks => prevBluebooks.filter(bluebook => bluebook._id !== bluebookId));
      toast.success('Bluebook deleted successfully');
    } catch (error) {
      console.error('Error deleting bluebook:', error);
      toast.error('Error deleting bluebook');
    }
  };

  return (
    <div className="admin-panel">
      <h2>All Bluebooks</h2>
      <div className="bluebook-list">
        {bluebooks.map(bluebook => (
          <div key={bluebook._id} className="bluebook-card">
            <h3>{bluebook.bluebookName}</h3>
            <p>{bluebook.vehicleNumber}</p>
            <p>Status: {bluebook.bluebookStatus}</p>
            <div className="button-group">
              <button onClick={() => handleViewDetails(bluebook)}>View Details</button>
              <button onClick={() => handleUpdateStatus(bluebook._id, 'approved')}>Approve</button>
              <button onClick={() => handleUpdateStatus(bluebook._id, 'not approved')}>Reject</button>
              <button onClick={() => handleDelete(bluebook._id)}>Delete</button>
            </div>
          </div>
        ))}
      </div>
      {selectedBluebook && (
        <div className="bluebook-details">
          <h2>Bluebook Details</h2>
          <div className="details-form">
            <div className="form-left">
              <p><strong>Bluebook Name:</strong> {selectedBluebook.bluebookName}</p>
              <p><strong>Vehicle Number:</strong> {selectedBluebook.vehicleNumber}</p>
              <p><strong>Status:</strong> {selectedBluebook.bluebookStatus}</p>
            </div>
            <div className="form-right">
              <p><strong>Registration Authority:</strong> {selectedBluebook.registrationAuthority}</p>
              <p><strong>Vehicle Class:</strong> {selectedBluebook.vehicleClass}</p>
              <p><strong>Fuel Type:</strong> {selectedBluebook.fuelType}</p>
            </div>
          </div>
          <div className="details-actions">
            <button onClick={() => setSelectedBluebook(null)}>Close</button>
            <button onClick={() => handleUpdateStatus(selectedBluebook._id, 'approved')}>Approve</button>
            <button onClick={() => handleUpdateStatus(selectedBluebook._id, 'not approved')}>Reject</button>
            <button onClick={() => handleDelete(selectedBluebook._id)}>Delete</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdminPanel;
